<style>
    body {

    }

        background-color: #0d6efd;

        font-size: 2.5rem;

        style="
            display: flex;
            align-items: center;
            justify-content: center;
            font-size: 1.5em;
            margin: 10px 0;
        "
    >

        <button @click="go(-1)">⬅</button>
        <span
            >{{ currIndex + 1 }} - {{ currIndex + pageSize }} из {{ data.length
            }}</span

        <button @click="go(10)">⮕⮕</button>
    </div>
    <div
        style="
            display: grid;
            grid-template-columns: repeat(auto-fit, 800px);
            grid-gap: 10px;
            justify-content: center;
        "
    >
        <div
            v-for="i in current"
            style="
                background-color: #eee;
                min-height: 620px;
                display: flex;
                flex-flow: column;
            "
        >

            <iframe style="width: 100%; height: 100%" :src="i"> </iframe>
        </div>
    </div>
